function ToggleButton() {
  return (
    <div class="h-screen w-screen bg-white flex items-center justify-center">
      <button class="flex items-center p-1 h-9 w-16 rounded-full bg-gray-200">
          <div class="shadow-md h-7 w-7 rounded-full bg-white"></div>
      </button>
    </div>
  );
}

export default ToggleButton;
